/*Table structure for table `sys_business` */

DROP TABLE IF EXISTS `sys_business`;

CREATE TABLE `sys_business` (
  `id` bigint(11) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `code` varchar(50) NOT NULL COMMENT '经营者编码',
  `name` varchar(50) NOT NULL COMMENT '经营者名称',
  `regId` varchar(50) NOT NULL COMMENT '工商注册登\r\n记证号或身\r\n份证号',
  `property` varchar(20) NOT NULL COMMENT '经营者性质',
  `type` int(1) NOT NULL COMMENT '经营类型，1：供应商、2：买家',
  `recordDate` datetime NOT NULL COMMENT '备案日期',
  `legalRepresent` varchar(20) NOT NULL COMMENT '法人代表',
  `addr` varchar(100) DEFAULT NULL COMMENT '地址',
  `tel` varchar(20) NOT NULL COMMENT '手机号码',
  `markType` int(2) NOT NULL COMMENT '标志位；0：供货商；1：买家；2：两者兼具',
  `nodeId` bigint(11) NOT NULL COMMENT '所属节点ID',
  `isDelete` int(11) DEFAULT '0' COMMENT '是否删除；0-否，1-是',
  `addTime` datetime NOT NULL COMMENT '添加时间',
  `updateTime` datetime DEFAULT NULL COMMENT '更新时间',
  `deleteTime` datetime DEFAULT NULL COMMENT '删除时间',
  PRIMARY KEY (`id`)
