/*Table structure for table `sys_login_account` */

DROP TABLE IF EXISTS `sys_login_account`;

CREATE TABLE `sys_login_account` (
  `id` bigint(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(50) DEFAULT NULL COMMENT '姓名',
  `account` varchar(200) DEFAULT NULL COMMENT '账号',
  `password` varchar(200) DEFAULT NULL COMMENT '密码',
  `nodeId` bigint(11) NOT NULL COMMENT '所属节点ID',
  `isDelete` int(2) DEFAULT '0' COMMENT '是否删除；0-否，1-是',
  `addTime` datetime NOT NULL COMMENT '添加时间',
  `updateTime` datetime DEFAULT NULL COMMENT '更新时间',
  `deleteTime` datetime DEFAULT NULL COMMENT '删除时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 COMMENT='用户登录信息';

