/*Table structure for table `tb_origin_harvest_info` */

DROP TABLE IF EXISTS `tb_origin_harvest_info`;

CREATE TABLE `tb_origin_harvest_info` (
  `id` bigint(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `nodeId` bigint(11) NOT NULL COMMENT '基地ID',
  `type` int(1) NOT NULL COMMENT '品类，1-肉类，2-菜类',
  `prodBatchId` varchar(20) NOT NULL COMMENT '种养殖批次号',
  `harvestBatchId` varchar(20) NOT NULL COMMENT '种养殖收获批次号',
  `harvestDate` datetime NOT NULL COMMENT '收获日期',
  `amount` double(10,2) DEFAULT NULL COMMENT '收获数量',
  `weight` double(10,2) DEFAULT NULL COMMENT '收货重量',
  `unit` varchar(10) DEFAULT NULL COMMENT '计量单位',
  `prodId` bigint(11) NOT NULL COMMENT '产品ID',
  `result` varchar(11) DEFAULT NULL COMMENT '检测结果,农残抑制率、0:不合格，1:合格',
  `sheetNo` varchar(50) DEFAULT NULL COMMENT '检测单号',
  `principalId` varchar(50) DEFAULT NULL COMMENT '收获负责人代码',
  `principalName` varchar(50) DEFAULT NULL COMMENT '收获负责人姓名',
  `isDelete` int(1) NOT NULL DEFAULT '0' COMMENT '是否删除；0-否，1-是',
  `addUserId` bigint(11) NOT NULL COMMENT '添加时间',
  `addTime` datetime NOT NULL COMMENT '添加时间',
  `updateUserId` bigint(11) DEFAULT NULL COMMENT '修改人',
  `updateTime` datetime DEFAULT NULL COMMENT '修改时间',
  `deleteUserId` bigint(11) DEFAULT NULL COMMENT '删除人',
  `deleteTime` datetime DEFAULT NULL COMMENT '删除时间',
  `isReport` int(2) DEFAULT '0' COMMENT '是否同步；0-未同步，1-已同步',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `tb_origin_harvest_info` */

/*Table structure for table `tb_origin_inputs_record` */

DROP TABLE IF EXISTS `tb_origin_inputs_record`;

CREATE TABLE `tb_origin_inputs_record` (
  `id` bigint(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `nodeId` bigint(11) NOT NULL COMMENT '基地ID',
  `prodBatchId` varchar(20) NOT NULL COMMENT '种养殖批次号',
  `inputsId` bigint(11) NOT NULL COMMENT '投入品ID',
  `type` int(1) NOT NULL COMMENT '品类，1-肉类，2-菜类',
  `inputsType` int(1) DEFAULT NULL COMMENT '投入品种类，1 种子、2 农药、3 化肥、4 幼崽、5 饲料、6 兽药、7 其他',
  `usedDate` datetime NOT NULL COMMENT '使用日期',
  `dailyConsumption` double(10,2) DEFAULT NULL COMMENT '是日使用量',
  `amount` double(10,2) DEFAULT NULL COMMENT '投入数量',
  `weight` double(10,2) DEFAULT NULL COMMENT '投入重量',
  `unit` varchar(4) DEFAULT NULL COMMENT '投入品使用单位',
  `principalId` varchar(20) DEFAULT NULL COMMENT '投入负责人代码',
  `principalName` varchar(50) DEFAULT NULL COMMENT '投入负责人名称',
  `isDelete` int(1) DEFAULT '0' COMMENT '是否删除；0-否，1-是',
  `addUserId` bigint(11) NOT NULL COMMENT '新增人',
  `addTime` datetime NOT NULL COMMENT '新增时间',
  `updateUserId` bigint(11) DEFAULT NULL COMMENT '更新人',
  `updateTime` datetime DEFAULT NULL COMMENT '更新时间',
  `deleteUserId` bigint(11) DEFAULT NULL COMMENT '删除人',
  `deleteTime` datetime DEFAULT NULL COMMENT '删除时间',
  `isReport` int(2) DEFAULT '0' COMMENT '是否同步；0-未同步，1-已同步',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=223 DEFAULT CHARSET=utf8;

