/*Table structure for table `tb_origin_out_info` */

DROP TABLE IF EXISTS `tb_origin_out_info`;

CREATE TABLE `tb_origin_out_info` (
  `id` bigint(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `nodeId` bigint(11) NOT NULL COMMENT '基地ID',
  `type` int(1) NOT NULL COMMENT '品类，1-肉类，2-菜类',
  `outDate` datetime NOT NULL COMMENT '出场日期',
  `prodBatchId` varchar(20) NOT NULL COMMENT '种养殖批次号',
  `harvestBatchId` varchar(20) DEFAULT NULL COMMENT '收获批次号',
  `prodId` bigint(11) NOT NULL COMMENT '产品ID',
  `qty` double(10,2) NOT NULL COMMENT '数量',
  `weight` double(10,2) NOT NULL COMMENT '重量',
  `price` double(10,2) DEFAULT NULL COMMENT '出场单价',
  `destCode` varchar(20) DEFAULT NULL COMMENT '到达地编码',
  `dest` varchar(50) DEFAULT NULL COMMENT '到达地名称',
  `transporterId` varchar(20) DEFAULT NULL COMMENT '运输车牌号',
  `quarantineId` varchar(20) NOT NULL COMMENT '产地证明号或检测合格证号或动物产地检疫合格证号',
  `traceCode` varchar(20) NOT NULL COMMENT '追溯码',
  `logisticsCode` varchar(30) DEFAULT NULL COMMENT '物流单号',
  `buyerId` bigint(11) DEFAULT NULL COMMENT '买方代码',
  `buyerName` varchar(100) DEFAULT NULL COMMENT '买方名称',
  `isDelete` int(1) NOT NULL DEFAULT '0' COMMENT '是否删除；0-否，1-是',
  `addUserId` bigint(11) NOT NULL COMMENT '新增人',
  `addTime` datetime NOT NULL COMMENT '新增时间',
  `updateUserId` bigint(11) DEFAULT NULL COMMENT '更新人',
  `updateTime` datetime DEFAULT NULL COMMENT '更新时间',
  `deleteUserId` bigint(11) DEFAULT NULL COMMENT '删除人',
  `deleteTime` datetime DEFAULT NULL COMMENT '删除时间',
  `isReport` int(2) DEFAULT '0' COMMENT '是否同步；0-未同步，1-已同步',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=15 DEFAULT CHARSET=utf8;

