CREATE TABLE `tb_origin_purchase_inputs` (
  `id` bigint(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `nodeId` bigint(11) NOT NULL COMMENT '所属机构ID',
  `pId` varchar(10) NOT NULL COMMENT '投入品ID',
  `type` int(1) NOT NULL COMMENT '品类，1-肉类，2-菜类',
  `purchaseType` int(1) DEFAULT NULL COMMENT '采购类型，1 种子、2 农药、3 化肥、4 幼崽、5 饲料、6 兽药、7 其他',
  `sourceType` int(1) DEFAULT NULL COMMENT '来源类型，1 自购、2 栽培、3 自养 、4 野生',
  `upperReaches` int(1) DEFAULT NULL COMMENT '上游是否建立电子台账,1 是、2 否',
  `purchaseBatchId` varchar(50) NOT NULL COMMENT '采购批次号',
  `purchaseDate` datetime NOT NULL COMMENT '采购日期',
  `organicFlag` int(1) DEFAULT NULL COMMENT '是否有机，0否、1是',
  `transgenicFlag` int(11) DEFAULT NULL COMMENT '是否转基因，0否、1是',
  `principalId` varchar(20) DEFAULT NULL COMMENT '采购负责人代码',
  `principalName` varchar(20) DEFAULT NULL COMMENT '采购负责人姓名',
  `purchaseAmount` double(10,2) DEFAULT NULL COMMENT '采购数量',
  `purchasePrice` double(10,2) DEFAULT NULL COMMENT '采购单价',
  `purchaseUnit` varchar(50) DEFAULT NULL COMMENT '采购单位',
  `totalWeight` double(10,2) DEFAULT NULL COMMENT '采购重量',
  `manufacturerDate` datetime DEFAULT NULL COMMENT '产品生产日期',
  `result` int(1) DEFAULT NULL COMMENT '检验结果，1 检验合格，0 检验不合格',
  `periodDate` datetime DEFAULT NULL COMMENT '产品保质期',
  `manufacturerId` varchar(18) DEFAULT NULL COMMENT '生产商代码',
  `manufacturerName` varchar(100) DEFAULT NULL COMMENT '生产商名称',
  `license` varchar(50) DEFAULT NULL COMMENT '生产经营许可证编号',
  `supplierId` bigint(11) DEFAULT NULL COMMENT '供应商ID(对应经营者供应商)',
  `supplierName` varchar(100) NOT NULL COMMENT '供应商名称',
  `isDelete` int(1) DEFAULT NULL COMMENT '是否删除；0-否，1-是',
  `addUserId` bigint(11) DEFAULT NULL COMMENT '新增人',
  `addTime` datetime DEFAULT NULL COMMENT '新增时间',
  `updateUserId` bigint(11) DEFAULT NULL COMMENT '更新人',
  `updateTime` datetime DEFAULT NULL COMMENT '更新时间',
  `deleteUserId` bigint(11) DEFAULT NULL COMMENT '删除人',
  `deleteTime` datetime DEFAULT NULL COMMENT '删除时间',
  `isReport` int(2) DEFAULT '0' COMMENT '是否同步；0-未同步，1-已同步',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='采购信息表';

/*Data for the table `tb_origin_purchase_inputs` */

